import { combineReducers } from "redux";

const typedHouseReducer = (houseType = 7, action) => {
  if (action.type !== "TYPE_OF_HOUSE") {
    return houseType;
  }

  switch (action.payload) {
    case "Small House":
      return (houseType = 5);
    case "Middle House":
      return (houseType = 7);
    case "Big House":
      return (houseType = 9);
  }
};

export default combineReducers({
  typedHouse: typedHouseReducer
});
